import React from "react";
import Moment from 'react-moment';
import { Link } from "react-router-dom";
import '../index.css'
// import {} from 'react-icons/ai'


export const PostItem = ({ post }) => {
    if (!post) {
        return (
            <div>
                Завантаження...
            </div>
        )
    }

    return (
        <Link to={`/${post._id}`} className='link-item'>
         <div className="postItem">
                <div className="postData"><Moment date={post.createdAt} format='D MMM YYYY' /></div>
                <h3 className="postTitle">{post.model}</h3>
            <div className="">

                <p>{post.urlOff}</p>
                <p>{post.urlBook}</p>
                <p>URL img</p>
                <div><p>{post.info}</p></div>
            </div>
        </div>
        </Link>

)}
